import styled from 'styled-components'

const bondButtonDisabled = styled.button`

    font-size: 18px;
    font-weight: 600;
    color: #FFFF;
    padding: 12px;
    justify-content: center;

    background-image: linear-gradient(#2D3544, #323B4A);
    border-radius: 15px;
    border: 1px;
    border-style: solid !important;
    border-color: #5F6C74 !important;
    min-width: 110px;
    :hover {
        background-image: linear-gradient(to right, #2D3544, #323B4A);
    } 
`

export default bondButtonDisabled
